	(22, 1, '2020-04-27 14:32:31', '2020-04-27 12:32:31', 'Vivamus vestibulum ut magna vitae facilisis. Maecenas laoreet lobortis tristique. Aenean accumsan malesuada convallis. Suspendisse egestas luctus nisl, sit amet', 'Coffee is health food: Myth or fact?', '', 'publish', 'open', 'open', '', 'coffee-is-health-food-myth-or-fact', '', '', '2020-04-27 14:32:31', '2020-04-27 12:32:31', '', 0, 'http://localhost/SalafiWebsite/?p=22', 0, 'post', '', 0),
	(23, 1, '2020-04-27 14:32:31', '2020-04-27 12:32:31', 'Fusce non nunc mi. Integer placerat nulla id quam varius dapibus. Nulla sit amet tellus et purus lobortis efficitur. Vivamus tempus posuere ipsum in suscipit. Quisque pulvinar fringilla cursus. Morbi malesuada laoreet dui, vitae consequat arcu vehicula vel. Fusce vel turpis non ante mollis bibendum a ac risus. Morbi ornare ipsum sit amet enim rhoncus, sed eleifend felis tristique. Mauris sed sollicitudin libero. In nec lacus quis erat rhoncus molestie.', 'Get more nutrition in every bite', '', 'publish', 'open', 'open', '', 'get-more-nutrition-in-every-bite', '', '', '2020-04-27 14:32:31', '2020-04-27 12:32:31', '', 0, 'http://localhost/SalafiWebsite/?p=23', 0, 'post', '', 0),
	(24, 1, '2020-04-27 14:32:31', '2020-04-27 12:32:31', 'The young team of Franziska Hildebrand, Franziska Preuss, Vanessa Hinz and Dahlmeier clocked 1 hour, 11 minutes, 54.6 seconds to beat France by just over 1 minute. Italy took bronze, 1:06.1 behind. Germany missed six targets overall, avoiding any laps around the penalty loop. Maria Dorin Habert of France, who has two individual gold medals at these worlds, passed Russia and France on the last leg and to take her team from fourth to second.', 'Women’s Relay Competition', '', 'publish', 'open', 'open', '', 'womens-relay-competition', '', '', '2020-04-27 14:32:31', '2020-04-27 12:32:31', '', 0, 'http://localhost/SalafiWebsite/?p=24', 0, 'post', '', 0),
	(25, 1, '2020-04-27 14:32:31', '2020-04-27 12:32:31', 'Chocolate bar marzipan sweet marzipan. Danish tart bear claw donut cake bonbon biscuit powder croissant. Liquorice cake cookie. Dessert cotton candy macaroon gummies sweet gingerbread sugar plum. Biscuit tart cake. Candy jelly ice cream halvah jelly-o jelly beans brownie pastry sweet. Candy sweet roll dessert. Lemon drops jelly-o fruitcake topping. Soufflé jelly beans bonbon.', 'A Paradise for Holiday', '', 'publish', 'open', 'open', '', 'a-paradise-for-holiday', '', '', '2020-04-27 14:32:31', '2020-04-27 12:32:31', '', 0, 'http://localhost/SalafiWebsite/?p=25', 0, 'post', '', 0),
	(26, 1, '2020-04-27 14:32:31', '2020-04-27 12:32:31', 'Nunc consectetur ipsum nisi, ut pellentesque felis tempus vitae. Integer eget lacinia nunc. Vestibulum consectetur convallis augue id egestas. Nullam rhoncus, arcu in tincidunt ultricies, velit diam imperdiet lacus, sed faucibus mi massa vel nunc. In ac viverra augue, a luctus nisl. Donec interdum enim tempus, aliquet metus maximus, euismod quam. Sed pretium finibus rhoncus. Phasellus libero diam, rutrum non ipsum ut, ultricies sodales sapien. Duis viverra purus lorem.', 'Destruction in Montania', '', 'publish', 'open', 'open', '', 'destruction-in-montania', '', '', '2020-04-27 14:32:31', '2020-04-27 12:32:31', '', 0, 'http://localhost/SalafiWebsite/?p=26', 0, 'post', '', 0),
